def Similarity_Matrix(genes, method, S_values):
	sim_matrix = []
	for idx,gene in enumerate(genes):
		#print(gene)
		sim_matrix.append([(lambda x: Similarity_of_Set_of_GOTerms(x[1],gene[1], method, S_values))(x) for x in genes])
	return sim_matrix

